import React from 'react';
import RecatDOM from 'react-dom';

import Heading from './Heading';
import Paragraph from './Paragraph';

RecatDOM.render(
  <>
    {/* <h1>Gaurav Kumar Singh</h1> */}
    <Heading></Heading>
    {/* <Heading></Heading> */}
    <Paragraph></Paragraph>
    {/* <p>These are my friend</p> */}
    <ol>
      <li>Aman</li>
      <li>Tiwari</li>
      <li>Tiwari</li>
      <li>Tiwari</li>
      <li>Tiwari</li>


    </ol>
  </>,
  document.getElementById('root')
);
